import React, { useState } from 'react';
import Calendar from 'react-calendar';

function App() {

  state = {
    date: new Date()
  }

  return (
    <div>
    <Calendar
      onChange={date => this.setState({ date })}
      value={state.date}
    />
  </div>
);
}

export default App;
